import React from "react";

import "./styles.css";
export default class Banner extends React.Component {
  render() {
    return (
      <section className="banner">
        <div className="count-down-area">
          <p className="count-down-area-text">ContDown Example</p>
        </div>
      </section>
    );
  }
}
